import logo from './logo.svg';
import './App.css';

function App() {
  // const names = ["Gaurav", "Priti", "Prakash", "Robin"];
  // creating array of object
  const users = [
    {name: "Gaurav", photo: "https://pbs.twimg.com/profile_images/959291281246642177/52oOzHVF_400x400.jpg"},
  ]
  return (
    <div className="App">
      <header className="App-header">
        {/* <Msg name="Gaurav"/>
        <Msg name="Priti"/>
        <Msg name="Prakash"/> */}
        {/* {names.map(nm => <Msg name={nm}/>)} */}
        {users.map((ur) => (<Msg name={ur.name} photo={ur.photo}/>))}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
  // function Msg(props) {
  //   // console.log(props)
  //   return(
  //     <div>
  //       <h1>Hellow, {props.name}!!!</h1>
  //     </div>
  //   ) ; 
  // }
  function Msg({name, photo}) {
    return(
      <div>
        <img 
          className="user-photo" 
          src={photo}
          alt={name}
        />
        <h1>Hellow, {name}!!!</h1>
      </div>
    ) ; 
  }
}

export default App;
